--  DDL for View V_OP_CUENTA
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "ANLYT"."V_OP_CUENTA" ("ID_CUENTA_COD", "CTA_ID_CATEGORIA_EDAD", "ID_SEGMENTO", "ID_CATEGORIA_EDAD", "EDAD_INICIAL", "EDAD_FINAL", "DESC_CATEGORIA_EDAD") AS 
  SELECT 
  OP_REDENCION_CUENTA.ID_CUENTA_COD,
  OP_REDENCION_CUENTA.ID_CATEGORIA_EDAD CTA_ID_CATEGORIA_EDAD,
  OP_REDENCION_CUENTA.ID_SEGMENTO,
  OP_CATEGORIA_EDAD.ID_CATEGORIA_EDAD,
  OP_CATEGORIA_EDAD.EDAD_INICIAL,
  OP_CATEGORIA_EDAD.EDAD_FINAL,
  OP_CATEGORIA_EDAD.DESC_CATEGORIA_EDAD
FROM OP_REDENCION_CUENTA
LEFT JOIN OP_CATEGORIA_EDAD ON OP_REDENCION_CUENTA.ID_CATEGORIA_EDAD = OP_CATEGORIA_EDAD.ID_CATEGORIA_EDAD
LEFT JOIN OP_SEGMENTO ON OP_REDENCION_CUENTA.ID_SEGMENTO = OP_SEGMENTO.ID_SEGMENTO;
