--  DDL for View V_OP_EVENTO
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "ANLYT"."V_OP_EVENTO" ("EVENTO_COD", "EVENTO_TIPO", "EVENTO_FECHA", "EVENTO_FECHA_YEAR", "EVENTO_FECHA_MONTH", "EVENTO_FECHA_DAY", "EVENTO_DIRECCION_IP", "EVENTO_CANAL", "EVENTO_RESP_NROCONFIRMACION", "EVENTO_RESP_COD", "EVENTO_RESP_DESCRIPCION", "ID_CAJA", "TX_ORIGEN_CUENTA", "TX_DESTINO_CUENTA", "ID_CAJERO", "BONO_SERIAL", "BONO_ESPECIE_COD", "BONO_EMISOR_COD", "BONO_ESPECIE_VER", "BONO_ESTADO", "BONO_VALOR", "BONO_DENOMINACION", "BONO_FECHA_VENCIMIENTO", "ID_EVENTORAW") AS 
  SELECT EVENTO_COD,
  EVENTO_TIPO,
  EVENTO_FECHA,
  extract(year  from EVENTO_FECHA) EVENTO_FECHA_YEAR,
  extract(month from EVENTO_FECHA) EVENTO_FECHA_MONTH,
  extract(day   from EVENTO_FECHA) EVENTO_FECHA_DAY,
  -- extract(hour from cast(EVENTO_FECHA as timestamp)) EVENTO_FECHA_HOUR,
  -- extract(minute from cast(EVENTO_FECHA as timestamp)) EVENTO_FECHA_MINUTE,
  EVENTO_DIRECCION_IP,
  EVENTO_CANAL,
  EVENTO_RESP_NROCONFIRMACION,
  EVENTO_RESP_COD,
  EVENTO_RESP_DESCRIPCION,
  ID_CAJA,
  TX_ORIGEN_CUENTA,
  TX_DESTINO_CUENTA,
  ID_CAJERO,
  BONO_SERIAL,
  BONO_ESPECIE_COD,
  BONO_EMISOR_COD,
  BONO_ESPECIE_VER,
  BONO_ESTADO,
  BONO_VALOR,
  BONO_DENOMINACION,
  BONO_FECHA_VENCIMIENTO,
  ID_EVENTORAW
FROM OP_EVENTO;
