--  DDL for View V_OP_POS
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "ANLYT"."V_OP_POS" ("CAJA_COD", "CAJA_ID_SUCURSAL", "ID_CAJA", "SUCURSAL_COD", "SUC_RAZON_SOCIAL", "SUC_LATITUD", "SUC_LONGITUD", "SUC_ID_CIUDAD", "SUC_ID_EMPRESA", "ID_SUCURSAL", "ID_CIUDAD", "PAIS_NOMBRE", "DEPARTAMENTO_COD", "DEPARTAMENTO_NOMBRE", "MUNICIPIO_COD", "MUNICIPIO_NOMBRE", "CIUD_LATITUD", "CIUD_LONGITUD", "ID_EMPRESA", "NIT", "EMP_RAZON_SOCIAL") AS 
  SELECT OP_REDENCION_CAJA.CAJA_COD, 
       OP_REDENCION_CAJA.ID_SUCURSAL CAJA_ID_SUCURSAL, 
       OP_REDENCION_CAJA.ID_CAJA,
       OP_SUCURSAL.SUCURSAL_COD,
       OP_SUCURSAL.RAZON_SOCIAL SUC_RAZON_SOCIAL,
       OP_SUCURSAL.LATITUD SUC_LATITUD,
       OP_SUCURSAL.LONGITUD SUC_LONGITUD,
       OP_SUCURSAL.ID_CIUDAD SUC_ID_CIUDAD,
       OP_SUCURSAL.ID_EMPRESA SUC_ID_EMPRESA,
       OP_SUCURSAL.ID_SUCURSAL,
       OP_CIUDAD.ID_CIUDAD,
       OP_CIUDAD.PAIS_NOMBRE,
       OP_CIUDAD.DEPARTAMENTO_COD,
       OP_CIUDAD.DEPARTAMENTO_NOMBRE,
       OP_CIUDAD.MUNICIPIO_COD,
       OP_CIUDAD.MUNICIPIO_NOMBRE,
       OP_CIUDAD.LATITUD  CIUD_LATITUD,
       OP_CIUDAD.LONGITUD CIUD_LONGITUD,
       OP_EMPRESA.ID_EMPRESA, 
       OP_EMPRESA.NIT, 
       OP_EMPRESA.RAZON_SOCIAL EMP_RAZON_SOCIAL
  FROM OP_REDENCION_CAJA,
       OP_SUCURSAL,
       OP_CIUDAD,
       OP_EMPRESA
 WHERE OP_REDENCION_CAJA.ID_SUCURSAL = OP_SUCURSAL.ID_SUCURSAL
   AND OP_SUCURSAL.ID_CIUDAD = OP_CIUDAD.ID_CIUDAD 
   AND OP_EMPRESA.ID_EMPRESA = OP_SUCURSAL.ID_EMPRESA;
